import React from 'react';

import './member.css';

const Member = props => {

    return (
        <div className="member">
            <img src={props.img} alt={props.title}/>
            <div className="titleAndContent">
                <h3>{props.title}</h3>
                <p>{props.content}</p>
            </div>
        </div>
    )
};

export default Member
